var types = require('../constants/ActionTypes');

var getTypesApi = '/api/types';
var getItemsApi = '/api/items';
var getItemsDataApi = '/api/items/data';
var getOrdersApi = '/api/orders';
var addOrderApi = '/api/orders/create';
var updateOrdersApi = '/api/orders/update';

var useMock = true;

function checkStatus(response) {
  if (response.status >= 200 && response.status < 300) {
    return response;
  } else {
    var error = new Error(response.statusText);
    error.response = response;
    throw error;
  }
}

function parseJSON(response) {
  return response.json();
}

function getPostJsonOption(data) {
  return {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json'
    },
    body: JSON.stringify(data)
  };
}

// Get all item types
export function fetchTypes() {
  return (dispatch) => {
    dispatch(setLoadingTypesState()); // Show a loading spinner

    if (useMock) {
      dispatch(doneFetchingTypes());
      dispatch(setTypes(mockGetTypes()));
    } else {
      fetch(getTypesApi)
        .then(checkStatus)
        .then(parseJSON)
        .then((data) => {
          dispatch(doneFetchingTypes()); // Hide loading spinner
          dispatch(setTypes(data));
        }).catch(function(error) {
          dispatch(errorFetchingTypes());
        });
    }
  }
}

function setLoadingTypesState() {
  return { type: types.FETCH_TYPES_REQUEST }
}

function doneFetchingTypes() {
  return { type: types.FETCH_TYPES_COMPLETE }
}

function errorFetchingTypes() {
  return { type: types.FETCH_TYPES_ERROR }
}

function setTypes(data) {
  return {
    type: types.SET_TYPES,
    data: data
  }
}

