// Get all item data
export function fetchItemMarketData() {
  return (dispatch) => {
    dispatch(setLoadingItemsDataState()); // Show a loading spinner

    if (useMock) {
      dispatch(doneFetchingItemsData());
      dispatch(setItemsData(mockGetItemsData()));
    } else {
      fetch(getItemsDataApi)
        .then(checkStatus)
        .then(parseJSON)
        .then((data) => {
          dispatch(doneFetchingItemsData()); // Hide loading spinner
          dispatch(setItemsData(data));
        }).catch(function(error) {
          dispatch(errorFetchingItemsData());
        });
    }
  }
}

function setLoadingItemsDataState() {
  return { type: types.FETCH_ITEMS_DATA_REQUEST }
}

function doneFetchingItemsData() {
  return { type: types.FETCH_ITEMS_DATA_COMPLETE }
}

function errorFetchingItemsData() {
  return { type: types.FETCH_ITEMS_DATA_ERROR }
}

function setItemsData(data) {
  return {
    type: types.SET_ITEMS_DATA,
    data: data
  }
}

