// Get all orders
export function fetchOrders() {
  return (dispatch) => {
    dispatch(setFetchingOrders()); // Show a loading spinner

    fetch(getOrdersApi)
      .then(checkStatus)
      .then(parseJSON)
      .then((data) => {
        dispatch(doneFetchingOrders()); // Hide loading spinner
        dispatch(setOrders(data));
      }).catch(function(error) {
        dispatch(errorFetchingOrders());
      });
  }
}

function setFetchingOrders() {
  return { type: types.POST_NEW_ORDER_REQUEST }
}

function doneFetchingOrders() {
  return { type: types.POST_NEW_ORDER_COMPLETE }
}

function errorFetchingOrders() {
  return { type: types.POST_NEW_ORDER_ERROR }
}

function setOrders(order) {
  return {
    type: types.SET_ORDERS,
    data: order
  }
}

// Post new order
export function postNewOrder(order) {
  return (dispatch) => {
    dispatch(setPostingOrder()); // Show a loading spinner

    fetch(addOrderApi, getPostJsonOption(order))
      .then(checkStatus)
      .then(parseJSON)
      .then((data) => {
        dispatch(donePostingNewOrder()); // Hide loading spinner
        dispatch(addOrder(data));
      }).catch(function(error) {
        dispatch(errorPostingOrder());
      });
  }
}

function setPostingOrder() {
  return { type: types.POST_NEW_ORDER_REQUEST }
}

function donePostingNewOrder() {
  return { type: types.POST_NEW_ORDER_COMPLETE }
}

function errorPostingOrder() {
  return { type: types.POST_NEW_ORDER_ERROR }
}

function addOrder(order) {
  return {
    type: types.ADD_ORDER,
    data: order
  }
}

// Post updated orders
export function postUpdatedOrders(orders) {
  return (dispatch) => {
    dispatch(setPostingUpdatedOrders()); // Show a loading spinner

    fetch(updateOrdersApi, getPostJsonOption(orders))
      .then(checkStatus)
      .then(parseJSON)
      .then((data) => {
        dispatch(donePostingUpdatedOrders()); // Hide loading spinner
        dispatch(updateOrders(data));
      }).catch(function(error) {
        dispatch(errorPostingUpdatedOrders());
      });
  }
}

function setPostingUpdatedOrders() {
  return { type: types.POST_ORDERS_UPDATE_REQUEST }
}

function donePostingUpdatedOrders() {
  return { type: types.POST_ORDERS_UPDATE_COMPLETE }
}

function errorPostingUpdatedOrders() {
  return { type: types.POST_ORDERS_UPDATE_ERROR }
}

function updateOrders(orders) {
  return {
    type: types.UPDATE_ORDERS,
    data: orders
  }
}
